        borderLeftWidth: 0.5,
        borderBottomWidth: 0.5,
        borderRightColor: '#ABABAB',
        borderTopColor: '#ABABAB',
        borderRightWidth: 0.5,
        borderTopWidth: 0.5,
        borderRadius: 8,
    },
    khung4: {
        marginBottom: 20,

        position: 'relative',
        width: '100%',
        height: '100%',
        flexDirection: 'row',
        alignItems: 'center',
        borderBottomColor: '#ABABAB',
        borderLeftColor: '#ABABAB',
        borderLeftWidth: 0.5,
        borderBottomWidth: 0.5,
        borderRightColor: '#ABABAB',
        borderTopColor: '#ABABAB',
        borderRightWidth: 0.5,
        borderTopWidth: 0.5,
        borderRadius: 8,
    },

    MOBILEText: {

        fontSize: 16,
        color: '#E94057',
        fontWeight: '700',
    },
    MOBILE: {
        position: 'absolute',
        flexDirection: 'row',
        justifyContent: 'flex-end',
        width: '90%',
        height: 24,
        top: 56,

    }
});
